import PropTypes from 'prop-types';
import Input from '../shared/Input/Input';

const Settings = props => {
    return (
        <div className='bg-indigo-600 h-full p-10'>
            <div className='bg-white flex flex-col rounded-2xl p-20'>
                <div className='bg-red-300 mx-auto w-11/12'>
                    <h1 className='text-2xl font-semibold mb-6'>General</h1>
                    <div className='flex justify-between bg-green-300'>
                        <div className='flex flex-col'>
                            <label className='mb-1.5 font-medium text-gray-600'>First Name</label>
                            <Input type={'text'} placeholder={'First Name'} id={'firstName'} />
                        </div>
                        <div className='flex flex-col w-2/5'>
                            <label className='mb-1.5 font-medium text-gray-600'>Last Name</label>
                            <Input type={'text'} placeholder={'Last Name'} id={'lastName'} />
                        </div>
                    </div>
                </div>
                <div></div>
                <div></div>
                <div></div>
            </div>
        </div>
    );
};

Settings.propTypes = {};

export default Settings;
